export const retrievePets
    = () => axios.get('http://localhost:9000/catalog/list?pageNo=1&pageSize=10', {
        headers: {
            'Authorization': 'Bearer ' + sessionStorage.getItem("bearer-token")
        }
    })


export const updatePet = (name) => axios.patch(`http://localhost:9000/catalog/update/${name}`, {
    headers: {
        'Authorization': 'Bearer ' + sessionStorage.getItem("bearer-token")
    }
})
